exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),url=`http://www.95shubao.net/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/class="novel_list"/,/<\/dl>\s*<\/div>/),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};